import React, {Component} from 'react';

class Form extends Component{
    constructor(props){
        super(props);
        this.state = {value: ""};
        this.handleChange = this.handleChange.bind(this);
    }
    render(){
        return (
            <form>
                <input type="text" value="" onChange={this.handleChange}/>
                <input type="submit" value="Submit Data"/>
            </form>
        )
    }
}

export default Form;
